{-# LANGUAGE GeneralizedNewtypeDeriving #-}
{-# LANGUAGE OverloadedStrings #-}
{-# LANGUAGE QuasiQuotes #-}

module OSL.Spec.OSLSpec (spec) where

import Control.Monad (forM_)
import Data.String (IsString)
import OSL.EntryPoint (CompileToCircuit (DONTCompileToCircuit), FileName (..), Output (..), TargetName (..), runMain)
import Test.Syd (Spec, describe, it, liftIO, shouldBe)
import Text.RawString.QQ (r)

spec :: Spec
spec =
  describe "OSL" $
    forM_ testCases runTestCase

data TestCase = TestCase TestFile TestName Expectation

newtype TestFile = TestFile String
  deriving (IsString)

newtype TestName = TestName String
  deriving (IsString)

newtype Expectation = Expectation String
  deriving (IsString)

runTestCase :: TestCase -> Spec
runTestCase (TestCase (TestFile fileName) (TestName testName) (Expectation expected)) =
  it
    ( "produces the expected result on "
        <> fileName
        <> " "
        <> testName
    )
    $ do
      result <-
        liftIO $
          runMain
            (FileName ("examples/" <> fileName <> ".osl"))
            (TargetName testName)
            DONTCompileToCircuit
      result `shouldBe` Output expected

